import * as React from 'react';
import { Avatar, Button, Card, Title, Paragraph, Text } from 'react-native-paper';
import { View, StyleSheet, Image, ScrollView, SafeAreaView } from 'react-native';
import { AntDesign } from '@expo/vector-icons';


const RestaurantCard = (props) => (
    <Card style={styles.shadow}>
        <Card.Cover source={{ uri: props.img }} style={{ borderRadius: 15, borderTopRightRadius: 15, borderTopLeftRadius: 15, height: 150, width: 330, }} />
        <Card.Title title={props.name} subtitle={props.city} />
        <Card.Content>
            <AntDesign name="star" size={25} color="orange" > <Text style={{color:'white'}}>{props.rating}</Text></AntDesign>
            <Paragraph>{props.foodType} cuisine</Paragraph>
        </Card.Content>
    </Card>
);

const styles = StyleSheet.create({

    shadow: {
        height: 300,
        width: 370,
        marginTop: 8,
        marginBottom: 8,
        elevation: 5,
        paddingTop: 15,
        alignItems: 'center',
        borderRadius: 15,
    },
})

export default RestaurantCard;

